import React, { useEffect, useState } from 'react';
import './appointment.css';

const Appointments = () => {
  const [appointments, setAppointments] = useState([]);
  const [activeRoom, setActiveRoom] = useState(null); // for showing embedded meeting
  const token = localStorage.getItem("token");

  useEffect(() => {
    const fetchAppointments = async () => {
      try {
        const res = await fetch("http://localhost:5000/api/appointments", {
          method: "GET",
          headers: {
            "Authorization": `Bearer ${token}`,
          },
        });

        if (!res.ok) {
          throw new Error(`Error: ${res.status}`);
        }

        const data = await res.json();
        setAppointments(data);
      } catch (err) {
        console.error("âŒ Failed to fetch appointments:", err);
      }
    };

    if (token) {
      fetchAppointments();
    } else {
      console.warn("ðŸš« No token found. User may not be logged in.");
    }
  }, [token]);

  const groupedAppointments = appointments.reduce((acc, apt) => {
    const key = apt.mainService;
    if (!acc[key]) acc[key] = [];
    acc[key].push(apt);
    return acc;
  }, {});

  const getVisibleColumns = (serviceGroup) => {
    const columns = new Set();
    serviceGroup.forEach(apt => {
      if (apt.spouseName) columns.add('spouse');
      if (apt.childName) columns.add('child');
      if (apt.mode === 'Online') columns.add('online');
    });
    return columns;
  };

  const handleJoin = (roomName) => {
    setActiveRoom(roomName);
  };

  return (
    <div className="appointments-page">
      <h2>Your Appointments</h2>
      {appointments.length === 0 ? (
        <p>No appointments found.</p>
      ) : (
        Object.entries(groupedAppointments).map(([service, items], idx) => {
          const visibleCols = getVisibleColumns(items);
          return (
            <div key={idx} className="service-group">
              <h3>{service}</h3>
              <table className="appointment-table">
                <thead>
                  <tr>
                    <th>Sub-Service</th>
                    <th>Name</th>
                    {visibleCols.has('spouse') && <th>Spouse</th>}
                    {visibleCols.has('child') && <th>Child</th>}
                    <th>Date</th>
                    <th>Time</th>
                    <th>Contact</th>
                    <th>Email</th>
                    {visibleCols.has('online') && <th>Meeting</th>}
                  </tr>
                </thead>
                <tbody>
                  {items.map((apt, i) => {
                    const roomName = `therapy-${apt._id}`;
                    return (
                      <React.Fragment key={i}>
                        <tr>
                          <td>{apt.subService}</td>
                          <td>{apt.name}</td>
                          {visibleCols.has('spouse') && <td>{apt.spouseName || '-'}</td>}
                          {visibleCols.has('child') && <td>{apt.childName || '-'}</td>}
                          <td>{apt.date}</td>
                          <td>{apt.time}</td>
                          <td>{apt.mobile}</td>
                          <td>{apt.email}</td>
                          {visibleCols.has('online') && (
                            <td>
                              {apt.mode === 'Online' ? (
                                <button onClick={() => handleJoin(roomName)}>
                                  Join Meeting
                                </button>
                              ) : (
                                '-'
                              )}
                            </td>
                          )}
                        </tr>
                        {activeRoom === roomName && apt.mode === 'Online' && (
                          <tr>
                            <td colSpan={visibleCols.size + 6}>
                              <div className="jitsi-container">
                                <iframe
                                  title="Jitsi Meeting"
                                  src={`https://meet.jit.si/${roomName}`}
                                  allow="camera; microphone; fullscreen; display-capture"
                                  style={{ width: '100%', height: '500px', border: 0 }}
                                />
                              </div>
                            </td>
                          </tr>
                        )}
                      </React.Fragment>
                    );
                  })}
                </tbody>
              </table>
            </div>
          );
        })
      )}
    </div>
  );
};

export default Appointments;
